import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

function EventoView() {
  const { id } = useParams();
  const [evento, setEvento] = useState({});

  useEffect(() => {
    console.log('Entre al useEffect');

    fetch(`http://localhost:3333/api/eventos/${id}`)
      .then(res => res.json())
      .then(data => {
        setEvento(data)
        console.log(data);
      })
  }, []);


  return (
    <div>
      <h1>EventoView</h1>
      <h2>{evento.titulo}</h2>
    </div>
  );
}

export default EventoView;
